	private List<Map<String, String>> listFilterMapTown = new ArrayList<Map<String, String>>();
	Gson gson = new Gson();
	Type listType = new TypeToken<ArrayList<Map<String, Map<String, String>>>>() {
	}.getType();
	Type listType2 = new TypeToken<ArrayList<Map<String, Object>>>() {
	}.getType();
	List<Map<String, String>> listMapCityTemp = new ArrayList<Map<String, String>>();
	List<Map<String, Object>> listTowns = new ArrayList<Map<String, Object>>();
	List<Map<String, String>> townslistmap = new ArrayList<Map<String, String>>();
	Map<String, String> mapCitiesId = null;
	Map<String, String> mapTownsId = null;

	private List<Map<String, String>> setCitiesMap() {
		List<Map<String, Map<String, String>>> citiesmap = gson.fromJson(
				cityValues[0], listType);
		listMapCity = new ArrayList<Map<String, String>>();
		for (Map<String, Map<String, String>> citiesmaptemp : citiesmap) {
			mapCitiesId = new HashMap<String, String>();
			mapCitiesId.put("provinceNo",
					citiesmaptemp.get("id").get("provinceNo"));
			mapCitiesId.put("cityNo", citiesmaptemp.get("id").get("cityNo"));
			mapCitiesId.put("cityName", citiesmaptemp.get("id").get("cityName"));
			listMapCity.add(mapCitiesId);
		}
		return listMapCity;
	}

	private List<Map<String, Object>> getTownsValue() {
		listTowns.clear();
		for (int i = 0; i < valuesTowns.length; i++) {
			List<Map<String, Object>> mapTowns = gson.fromJson(valuesTowns[i],
					listType2);
			listTowns.addAll(mapTowns);
		}
		return listTowns;
	}

	private List<Map<String, String>> setTownsMap() {
		List<Map<String, Object>> townsmaptemp = this.getTownsValue();
		townslistmap = new ArrayList<>();
		for (Map<String, Object> subtownsmap : townsmaptemp) {
			mapTownsId = new HashMap<String, String>();
			Map<String, String> mapIdtemp = (Map<String, String>) subtownsmap.get("id");
			String areaName = (String) subtownsmap.get("areaName");
			mapTownsId.put("provinceNo", mapIdtemp.get("provinceNo"));
			mapTownsId.put("cityNo", mapIdtemp.get("cityNo"));
			mapTownsId.put("areaNo", mapIdtemp.get("areaNo"));
			mapTownsId.put("areaName", areaName);
			townslistmap.add(mapTownsId);
		}
		return townslistmap;
	}

	public List<Map<String, String>> getListMapTown(String provinceNo,
			String cityNo) {
		listFilterMapTown.clear();
		for (Map<String, String> tempMap : getListMapTown()) {
			if (provinceNo.equals(tempMap.get("provinceNo"))
					&& (cityNo.equals(tempMap.get("cityNo")))) {
				listFilterMapTown.add(tempMap);
			}
		}
		return listFilterMapTown;
	}

	public List<Map<String, String>> getListMapCity() {
		listMapCity = setCitiesMap();
		return listMapCity;
	}

	public List<Map<String, String>> getListMapTown() {
		listMapTown = this.setTownsMap();
		return listMapTown;
	}

